import logo from './logo.svg';
import './App.css'; 
import React from 'react';
import ControlCard from './Components/ControlCard'


 export default function App() {
  const titleArray = ['Banking','Logistic', 'E-Commerce','Computer'];
  return (
    <div>     
      <header class="text-green-500">
        Monitoring System
      </header> 
  
        <div className="mt-4"> {/* Adds margin-top to create space below the Topbar */}
          {titleArray.map(eachTitle => (
              <div class="ms-3 mb-3" key={eachTitle}> {/* ms-3 for left margin, mb-3 for bottom margin for each card */}
                  <ControlCard title={eachTitle} />
              </div>
          ))}
        </div>
        
      {/* Adding Flexbox div */}
        <div className="flex">
          <div>1</div>
          <div>2</div>
          <div>3</div>
        </div>

      {/* {footer} */}
        <footer className="text-mt-8">
          This Footer
          </footer>
    </div>
);
}

 
